<b>Публикации авторов сферического пространства</b>


<br><br>Суть проекта "Сферические специи" - это образное символическое по аналогии сравниваемое со специями, которые принято применять в гастрономии для сохранения или усиления вкуса пищи. Другими словами, в сравнении со специями проект "Доставляет" и обеспечивает правильную подачу информации (без искажения истинного смысла). Так называемая, "Пища для мышления" - информация, где стиль и методы описания выступают некоторой "Приправой" для правильного восприятия информации. Так сказать, "Просвещение" на частоте "Белого шума", в высших и низших частотах всех сфер призрачной жизни, на стыке нейронауки и лингвистики (психолингвистики), что изучает взаимоотношение языка, мышления и сознания."Доставка" истины в том виде, в котором была задумана автором
