<br><a href="https://vk.com/doc-104438957_593604356"><span style="color:#6B8E23">Регистрация</span></a>
<br><br>
Семантическое смысловое поле речи используемой при наборе машиной данного текста, а именно его содержания легко, доступно и понятно по смыслу, среднестатистическому психически здоровому носителю русского языка. Людвиг Витгенштейн говорил, - Что значение слово должно пониматься как употребление. - В зависимости от той или иной ситуации, манеры речи и стиля общения. Традиционное понимание значения слова отступает на задний план. К примеру, значение слова груша - это логотип или бренд той или иной компании. Таким образом, значение слова должно пониматься не как обычное употребление, а зависит от конкретного текста услышанного и распознанного машиной. Другими словами, машина распознает и запоминает слова, понимает о чем шла речь в набранном ею тексте, однако не может постичь таинства сакрального смысла, которое понимают сферические специалисты - конспирологи. Машина понимает язык, но находится вне семантической связи с мыслителем и не абстрагируется за пределы языковой игры слов


